import React from "react";
import { Image, Grid, Dropdown, Menu } from "semantic-ui-react";
export default function brands() {
  const friendOptions = [
    {
      key: "Christian",
      text: "Christian",
      value: "Christian",
    },
    {
      key: "Matt",
      text: "Matt",
      value: "Matt",
    },
    {
      key: "Justen Kitsune",
      text: "Justen Kitsune",
      value: "Justen Kitsune",
    },
  ];

  return (
    <div>
      <Grid>
        <Grid.Column width={4}>
          <Dropdown
            placeholder="I open on focus"
            openOnFocus
            selection
            options={friendOptions}
          />
        </Grid.Column>
        <Grid.Column width={12}>
          <Image src="images/markalar1.PNG" centered />
        </Grid.Column>
      </Grid>
    </div>
  );
}
